// src/App.js
import React from 'react'
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom'

import ResumePage    from './pages/ResumePage'
import InterviewPage from './pages/InterviewPage'
import DashboardPage from './pages/DashboardPage'  // ← 새로 추가
import ExportPage    from './pages/ExportPage'

function App() {
  return (
    <Router>
      {/* ─── 상단 메뉴 ─── */}
      <nav className="p-4 bg-gray-200 flex space-x-4">
        <Link to="/resume"    className="hover:underline">Resume</Link>
        <Link to="/interview" className="hover:underline">Interview</Link>
        <Link to="/dashboard" className="hover:underline">Dashboard</Link>  {/* ← 새로 추가 */}
        <Link to="/export"    className="hover:underline">Export</Link>
      </nav>

      {/* ─── 페이지 라우팅 ─── */}
      <Routes>
        <Route path="/resume"    element={<ResumePage />} />
        <Route path="/interview" element={<InterviewPage />} />
        <Route path="/dashboard" element={<DashboardPage />} />  {/* ← 새로 추가 */}
        <Route path="/export"    element={<ExportPage />} />
        {/* 그 외 경로는 Resume로 포워딩 */}
        <Route path="*"          element={<ResumePage />} />
      </Routes>
    </Router>
  )
}

export default App
